column8:
アルミナムチェンジボススペーサー オールレッド<br><br><br>●付属の六角レンチで取り付け超かんたん！<BR>●モモ、ナルディピッチのステアリング及びボスに装着可能！<BR>●ステアリングとボスの間に取り付けるだけでベストドライビングポジションが得られます<BR>●アルミナムデザインにより、今まで以上に車内を引き立てます！<BR>●本製品は従来のスペーサーと違い、1セットで5ミリ幅ごとに6種類の高さ調整が可能で経済的！（5mm、10mm、15mm、20mm、25mm、30mm） <br><br><br>■詳細<br>種別：ボススペーサー<br>品番：HK81C<br>カラー：オールレッド<br>材質：アルミダイカスト<BR>製造：日本製 HKB SPORTS（東栄産業）<BR>付属：<br>MOMO用ホーンリング<br>5～20mm用ネジセット<br>25～30mm用ネジセット<style type="text/css">
